charge\n    df_os = df_2mu.Filter(\"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\"Dimuon_mass\", \"ROOT::VecOps::InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Book histogram of dimuon mass spectrum\n    bins = 30000  # Number of bins in the histogram\n    low = 0.25  # Lower edge of the histogram\n    up = 300.0  # Upper edge of the histogram\n    hist = df_mass.Histo1D(ROOT.RDF.TH1DModel(\"\", \"\", bins, low, up), \"Dimuon_mass\")\n\n    hist.GetValue() # triggers the event loop\n\n\nif __name__ == '__main__':\n    \n    #filelist = [\"input_files/dimuon/f{}.root\".format(i) for i in range(1, 101)]\n    #df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client) \n   \n    #import pdb; pdb.set_trace()\n   \n    for r in range(3):\n        filelist = [\"input_files/dimuon/f{}.root\".format(i+r) for i in range(1, 11)]\n        df = RDataFrame(\"Events\", filelist, npartitions=256, daskclient=client)\n        client.wait_for_workers(cores*nodes)\n        with performance_report(filename=\"dask-report-present_{}.html\".format(r)):\n            dimuonSpectrum(df)\n    client.close()\n\n        &lt;/pre&gt;\n        "},"id":"3612","type":"Div"},{"attributes":{},"id":"3688","type":"AllLabels"},{"attributes":{"coordinates":null,"formatter":{"id":"3652"},"group":null,"major_label_policy":{"id":"3653"},"ticker":{"id":"3264"},"visible":false},"id":"3263","type":"LinearAxis"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"3739","type":"AdaptiveTicker"},{"attributes":{"axis":{"id":"3263"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"3266","type":"Grid"},{"attributes":{"overlay":{"id":"3235"}},"id":"3232","type":"BoxZoomTool"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"3671"},{"id":"3672"},{"id":"3673"},{"id":"3
